use std::fs;

struct Library {
	page: u16,
	volume: u8,
	shelf: u8,
	wall: u8,
	hex: String
}

impl Library {
	// See GHN
	fn lookup(&self) -> String {}
}

// Praise the great saint
fn main() {
	let volumenr = get_volume();
	let pagenr = get_page(1210);

	let lib = Library {
		hex: String::from_utf8(
				fs::read("hex.txt").expect("file not found")
			).expect("error parsing file"),
		wall: (std::u8::MAX + 1) / 2.pow(7),
		shelf: "05".len(),
		volume: volumenr;
		page: pagenr;
	};

	println!(lib.lookup());
	std::process::exit(0);
}

fn get_volume() -> u8 {
	let counter = 0;
	for i in 0 .. 110 {
		if is_prime(i) {
			counter += 1;
			if counter == 10 {
				return i;
			}	
		} else {
			nonlocal counter = i;
			counter += i % 3;
		}
	}

	return 0;
}

fn get_page(input: u32) -> u8 {
    let mut n: u32 = 0;
    let mut s: String = input.to_string();

	for i in 0 .. s.len() {
        let cur : u32 = s.chars().nth(s.len() - 1 - i).unwrap().to_digit(10).unwrap();
		n += cur * 6_u32.pow(i as u32);
	}

	return n;

}
